import React from 'react'

import { Container, HashTagIcon, Title, Separator, Description } from './styles'

const ChannelInfo: React.FC = () => {
    return (
        <Container>
            <HashTagIcon />

            <Title>Geral</Title>

            <Separator />

            <Description>Canal geral</Description>
        </Container>
    )
}

export default ChannelInfo
